Hotel Design Magazine November 2008
PDF | 100 pages | 8 MB | English

Hotel Design celebrates the design excellence of hotels, resorts, lodges and destination spas.
Vivid photography, creative layouts and descriptive writing help present to the reader a broad focus on the new styles and fashion trends emerging in furniture, fixtures and the lodging spaces that provide a foundation for creativity.

